import React from 'react';
import './App.css';
import CardList from './CardList';
import {robots} from './robots';
import searchBox from './SearchBox';


const App = () => {
  return (
    <div className="tc">
      <header className="">
        <h1>Robofriends</h1>
        <input type="text" placeholder="searchBox robots" />
      </header>
      <SearchBox />
      <CardList robots={robots} />
    </div>
  );
}

export default App;
